import {useState} from "react";

function FruitForm() {
  const [fruit, setFruit] =useState({
    Name: "",
    Price: 0
  })
  function handleChange(evt) {
	const value = evt.target.value;
	setFruit({
	  ...fruit,
	  [evt.target.name]: value
	});
  }
  return (

    <form>
      <label>
        Fruit Name
        <input
          type="text"
          name="Fruit"
          value={fruit.Name}
          onChange={handleChange}
        />
      </label>
      <label>
        Price
        <input
          type="text"
          name="Price"
          value={fruit.Price}
          onChange={handleChange}
        />
      </label>
    </form>

  );
}
export default FruitForm;
